})
export class ButtonsComponent implements OnInit {
  count = 0;
  constructor() {}

  start() {}

  ngOnInit() {}
}
<p>
  <button class="start-btn" (click)="test($event)">Start</button>
  <button class="stop-btn">Stop</button>
